INSERT INTO `efflux_content`.`images` (`id`, `path`, `title`, `alt`) VALUES
(1, 'best-way-to-save-money-2.jpg', 'Life_Savings_In_Fish_Bowl', 'A fish bowl that is labeled ''savings.''  There are rolls of dollar bills and stacks of coins inside the bowl and around it.'),
(2, 'budget-save-money-piggybank-1.jpg', 'Money_in_piggy_bank', 'A stream of coins is falling from above into a piggy bank. Around the piggy bank are additional stacks of coins.'),
(3, 'how-to-save-money-empty-wallet-1.jpg', 'Man_looking_in_empty_wallet', 'A man wearing a suit''s hands can be seen opening a wallet with nothing in it. He has not saved any money.'),
(4, 'grow-money-financial-freedom-2.jpg', 'coins_sprouting_growth', 'Three stacks of coins are on a table, getting taller from left to right. A plant is sprouting from each of them, growing.'),
(5, 'realtor-buying-new-house-2.jpg', 'Realtor_looking_over_contract', 'A realtor standing in an empty house looks over a purchase agreement for a client who is buying property.'),
(6, 'how-to-choose-realtor-1.jpg', 'man_with_realtor_label', 'A man in a suit is holding out a label that says ''realtor.'' Realtors are known for letting everyone know they can help.'),
(7, 'garage-sale-make-money-fast-1.jpg', 'Garage_sale_sign', 'A sign indicating a garage sale can be seen in front of items on the front lawn.'),
(8, 'retail-arbitrage-easy-way-to-make-money-2.jpg', 'Store_closing_sale_signs', 'A variety of store closing signs can be seen hanging from the ceiling, everything in the store is 30 - 60% off.'),
(9, 'buying-real-estate-investment-1.jpg', 'Buying_a_new_house', 'two hands can be seen exchanging in a real estate transaction.. one hand has a bag of money, the other a model home.'),
(10, 'real-estate-investment-tips-2.jpg', 'handing_over_house_keys', 'Someone''s hand can be seen handing over the keys to someone else for a new house, which is seen in the background.'),
(11, 'raise-credit-score-2.jpg', 'Credit_score_ranking', 'A hand can be seen checking the box next to 5 star credit on a chalk board. 1-4 star credit are listed below.'),
(12, 'boost-your-credit-fast-1.jpg', 'boost_your_credit_fast', '''Boost Your Credit Score Fast'' is in writing with an arrow pointed up. A rating scale from ''poor'' to ''excellent'' is adjacent.'),
(13, 'body-transformation-without-starving-2.jpg', 'Mans_before_and_after_weight_loss', 'The same man, shown before and after losing signficant weight, are facing each other. One has a large belly, not the other.'),
(14, 'lose-weight-without-starving-1.jpg', 'get_slim_by_eating_healthy', 'A slim and fit woman stands before a table of fruits and vegtables with a tape measure around her waist.'),
(15, 'choose-healthy-food-diet-advice-2.jpg', 'Crossroads_between_health_and_pizza', 'A man stands at a crossroads. To the left is pizza and hamburgers, to the right are green vegetables.'),
(16, 'junk-food-bad-diet-advice-1.jpg', 'belly_ache_from_junk_food', 'A woman stands holding her stomach in pain as she looks down on a table of pizza, hamburgers, and junk food.'),
(17, 'transform-your-body-burn-fat-1.jpg', 'Man_flexing_biceps', 'A very fit and muscular man stands flexing his biceps, the words ''transform your body'' are titled to his left.'),
(18, 'lower-scale-weight-burn-fat-2.jpg', 'Tape_measure_scale', 'A bathroom scale is on the ground with a yellow tape measure wrapped around it, symbolizing weight loss.'),
(19, 'trail-running-ultra-marathon-training-2.jpg', 'ultrarunner_racing_on_mountain_trail', 'An ultrarunner is seen racing on a remote single track dirt trail with a beautiful snow capped mountain in the background'),
(20, 'running-an-ultra-marathon-1.jpg', 'racers_running_through_desert', 'A group of ultrarunners can be seen running in a line as they race through the desert during an ultra marathon.'),
(21, 'lower-scale-weight-1.jpg', 'tape_measure_around_scale', 'A bathroom scale is on the ground with a yellow tape measure wrapped around it, symbolizing weight loss.'),
(22, 'weight-loss-lose-inches-2.jpg', 'Woman_shows_weight_loss', 'A fit woman with bare mid section is seen showing how large her pants have become, indicating weight loss.'),
(23, 'new-runner-stretching-1.jpg', 'New_runner_stretching_quads', 'A runner who appears new to the sport is standing in a scenic park, holding onto fence, and stretching his quad behind him.'),
(24, 'new-to-running-reading-tips-2.jpg', 'New_to_running_reading_tips', 'A runner that is labeled ''the newbie'' is seen doing a side stretch and looking down at a running magazine on the ground'),
(25, 'wearing-new-running-shoes-2.jpg', 'Wearing_new_running_shoes', 'A runner''s feet can be seen standing on the road in a brand new pair of black running shoes.'),
(26, 'choose-the-right-running-shoes-1.jpg', 'runnign_shoe_selection', 'A wall in a running shoe store displays many options for running shoes on it''s shelves. The sign above says ''ready to run'''),
(27, 'glasses-of-water-per-day-2.jpg', 'glass_filling_with_water', 'A water bottle with clean, crisp water is seen pouring into an almost full glass of water.'),
(28, 'drink-more-water-human-body-1.jpg', 'Humans_are_60%_water', 'The outline of a human can be seen filled 60% to the top with water. The title above reads ''Our bodies are 60% water'''),
(29, 'calories-for-weight-loss-2.jpg', 'Nutritional_facts_and_tape_measure', 'The nutritional facts for a food item can be seen with a yellow tape measure sitting on top of it, symbolizing weight loss'),
(30, 'tracking-calories-for-weight-loss-1.jpg', 'counting_calories_notebook', 'A pen sits on top of a notebook with notes about calories for food choices that day. Next to the notebook is a calculator.'),
(31, 'weight-loss-transformation-tips-1.jpg', 'Woman_weight_loss_before_and_after', 'A woman is shown, on the left as overweight, on the right as skinny, with the title ''weight loss hacks'' and arrow between.'),
(32, 'lose-weight-smaller-pant-size-2.jpg', 'showing_off_weight_loss', 'A woman shows her weight loss progress by showing how her pants are too big at waist, titled ''lose weight, get fit, be healthy'''),
(33, 'beginner-crossfit-class-1.jpg', 'beginner_crossfit_class', 'A crossfit teacher stands infront of a class with a PVC pipe, showing the class how they should hold a barbell.'),
(34, 'starting-crossfit-class-2.jpg', 'crossfit_class_overhead_lunges', 'A crossfit class is seen lined up next to eachother holding weighted plates above their head as they do lunges.'),
(35, 'smaller-waist-lose-weight-1.jpg', 'skinny_woman_with_tape_measure_belt', 'A skinny woman is seen wearing a tape measure for a belt, symbolizing weight loss.'),
(36, 'alternative-weight-loss-strategies-1.jpg', 'Sugar_vs_syrup_example', 'On the left, a spoon of sugar with the red label ''don''t,'' On the right a spoon full of artifical sweetner with green label ''do'''),
(37, 'overweight-at-new-gym-1.jpg', 'overweight_man_frustrated_in_gym', 'An overweight man in athletic clothes looks frustrated as he leans on cardio equipment with his hand on his head.'),
(38, 'working-out-at-new-gym-2.jpg', 'active_gym_community', 'A gym with a lot of cardio equipment is being used by a variety of happy members, running, biking, and doing sit ups.'),
(39, 'best-deal-on-new-car-2.jpg', 'Money_for_keys_of_SUV', 'A small model sized SUV can be seen with car keys and a pile of twenty dollar bills next to it. Someone is buying a new car'),
(40, 'save-money-buying-new-car-1.jpg', 'Car_salesman_stacks_coins', 'A car salesman is stacking coins next to a model sized sedan, symbolizing money saved on a new car purchase.'),
(41, 'selling-car-for-the-most-money-2.jpg', 'car_keys_being_handed_over', 'Someone''s hand can be seen dropping the keys to a car into another person''s hand. The car can be seen in the background.'),
(42, 'how-to-maximize-car-resale-value-1.jpg', 'Car_thinking_its_time_to_sell', 'A sedan is seen driving down the freeway towards a city skyline at night, showing a thought bubble with a ''for sale'' sign'),
(43, 'save-money-buying-used-car-1.jpg', 'car_keys_next_to_money', 'A car key is seen being used as a paperweight for a stack of 4 100 dollar bills.'),
(44, 'best-tip-for-buying-used-car-2.jpg', 'car_is_a_savings_bank', 'An illistration of a car being used as a piggy bank for a hand to deposit a coin into, indicating that cars have money value.'),
(45, 'how-to-keep-car-clean-2.jpg', 'wiping_down_the_cup_holders', 'A hand wearing a cleaning glove can be seen wiping down the cup holders and center console of a car as they clean it.'),
(46, 'tips-for-cleaning-car-1.jpg', 'dirty_car_that_needs_washing', 'The dirty back windshield of a van can be seen with the words ''wash me'' written into the dirt.'),
(47, 'rv-on-cross-country-road-trip-1.jpg', 'rv_headed_down_the_highway', 'An RV is seen driving down a desserted desert highway, clearly on a roadtrip as there is nothing else around it.'),
(48, 'having-fun-on-road-trip-2.jpg', 'relaxing_on_the_road_trip', 'A pair of feet can be seen crossed and relaxed, sitting on the yellow dividing line in the middle of the highway.'),
(49, 'man-with-bad-road-rage-1.jpg', 'angry_man_with_road_rage', 'An angry man in a dress shirt and tie is seen hanging out the window of his car yelling, his fist clenched in the air.'),
(50, 'avoid-road-rage-in-traffic-2.jpg', 'happy_face_during_traffic', 'A black and white scene of a car sitting in traffic, with a yellow happy emoji face showing that they don''t have road rage.'),
(51, 'social-media-influencer-2.jpg', 'Social_icons_bring_people_together', 'An animation of people interacting with eachother around larger than life icons of ''typing,'' ''hashtag,'' ''love,'' and ''like.'''),
(52, 'how-to-become-social-media-influencer-1.jpg', 'creating_content_for_audience', 'Influencer creating content, which is being filmed by larger than life camera and displayed to onlooking audience.'),
