(64, 'torrey-pines-hike-san-diego-2.jpg', 'Torrey_pines_hike_stairs', 'A scenic view of the trails at Torrey Pines State Reserve, the trail is a series of wooden stairwells going down the cliffs.'),
(65, 'tsa-line-airport-anxiety-2.jpg', 'line_for_tsa_at_the_airport', 'An  overcrowded and stressful scene of many people waiting in line for a TSA checkpoint at the airport.'),
(66, 'airport-terminal-stress-free-1.jpg', 'relaxing_empty_airport_terminal', 'An empty, clean airport terminal that looks relaxing. Large floor to ceiling windows in the background show a plane fly by.'),
(67, 'bungee-jump-stratosphere-las-vegas-2.jpg', 'getting_ready_to_bungee_jump_in_vegas', 'Someone waiting on the edge to bungee jump off of the Strat Hotel in Las Vegas. What a thrill!'),
(68, 'drive-fast-super-car-las-vegas-1.jpg', 'Super_car_racing_around_track', 'An exotic supercar races around a track in Las Vegas, zooming past the camera at a high speed. This looks like quite a thrill!'),
(69, 'la-jolla-beach-san-diego-1.jpg', 'scenic_la_jolla_beach', 'Big waves crash up onto the beach in scenic La Jolla, as tourists and San Diego residents enjoy a day at the beach.'),
(70, 'best-san-diego-beach-2.jpg', 'Neon_beach_in_san_diego', 'A surreal image of a neon beach in San Diego, symbolizing how cool and amazing the beaches in San Diego are!'),
