(72, 'most-important-backpacking-gear-1.jpg', 'essentials_of_backpacking_gear', 'A variety of the most important pieces of backpacking gear are shown in a collage drawing.'),
(73, 'ocean-beach-pier-san-diego-2.jpg', 'ocean_beach_pier_from_above', 'An ariel photo of the Ocean Beach walking pier with the coastline in the background. The longest pier on the west coast!'),
(74, 'balboa-park-fountain-museum-san-diego-1.jpg', 'balboa_park_at_night', 'A scenic image of Balboa Park in twilight, one of many fountains in the park is shown with museums in the background'),
